        <div>
          <SideImage />
        </div>
      </div>
      <div
        style={{
          width: "50%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          backgroundColor: "#C3C9D2",
       flexDirection:"column"
        }}
      >
        <d></d>
        <div style={{margin:"12px"}}>
          <InputFields placeholder={"User Name"} />
        </div>
        <div>
          <InputFields placeholder={"Password"} />
        </div>
      </div>
    </div>
  );
};

export default Login;
